import React, { useState, useEffect } from 'react';

const AdminDashboard = ({ token, agentId }) => {
  const [activeView, setActiveView] = useState('viewUsers');
  const [users, setUsers] = useState([]);
  const [tickets, setTickets] = useState([]);
  const [profile, setProfile] = useState({});
  const [selectedTicketAssign, setSelectedTicketAssign] = useState('');
  const [selectedAgent, setSelectedAgent] = useState('');
  const [openTickets, setOpenTickets] = useState([]);
  const [availableAgents, setAvailableAgents] = useState([]);

  useEffect(() => {
    if (activeView === 'viewUsers' && token) {
      fetch('http://localhost:8080/api/users', {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      })
        .then(response => response.json())
        .then(data => setUsers(data))
        .catch(error => console.error('Error fetching users:', error));
    }

    if (activeView === 'viewTickets' && token) {
      fetch('http://localhost:8080/api/tickets', {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      })
        .then(response => response.json())
        .then(data => setTickets(data))
        .catch(error => console.error('Error fetching tickets:', error));
    }

    if (activeView === 'assignTickets' && token) {
      fetch('http://localhost:8080/api/tickets', {
        headers: { 'Authorization': `Bearer ${token}` },
      })
        .then(res => res.json())
        .then(data => {
          const open = data.filter(ticket => ticket.state === 'OPEN');
          setOpenTickets(open);
        });

      fetch('http://localhost:8080/api/users/agents', {
        headers: { 'Authorization': `Bearer ${token}` },
      })
        .then(res => res.json())
        .then(setAvailableAgents);
    }

    if (activeView === 'viewProfile' && token && agentId) {
      fetch(`http://localhost:8080/api/users/${agentId}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      })
        .then(response => response.json())
        .then(data => setProfile(data))
        .catch(error => console.error('Error fetching profile:', error));
    }
  }, [activeView, token, agentId]);

  const assignTicket = () => {
    if (!selectedTicketAssign || !selectedAgent) return;

    fetch(`http://localhost:8080/api/tickets/${selectedTicketAssign}/assign`, {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ agentId: selectedAgent }),
    })
      .then(res => {
        if (!res.ok) throw new Error('Failed to assign ticket');
        return res.json();
      })
      .then(() => {
        setActiveView('viewTickets'); // refresh after assignment
      })
      .catch(err => {
        console.error('Error assigning ticket:', err);
      });
  };

  return (
    <div>
      <h1>Admin Dashboard</h1>
      <div>
        <button onClick={() => setActiveView('viewUsers')}>View Users</button>
        <button onClick={() => setActiveView('viewTickets')}>View Tickets</button>
        <button onClick={() => setActiveView('assignTickets')}>Assign Tickets</button>
        <button onClick={() => setActiveView('viewProfile')}>View Profile</button>
      </div>

      {activeView === 'viewUsers' && (
        <div>
          <h2>Users</h2>
          <ul>
            {users.map(user => (
              <li key={user.id}>{user.email} - {user.role}</li>
            ))}
          </ul>
        </div>
      )}

      {activeView === 'viewTickets' && (
        <div>
          <h2>Tickets</h2>
          <ul>
            {tickets.map(ticket => (
              <li key={ticket.id}>
                {ticket.title} - {ticket.state} - Assigned to: {ticket.assignedAgent?.email || 'Unassigned'}
              </li>
            ))}
          </ul>
        </div>
      )}

      {activeView === 'assignTickets' && (
        <div>
          <h2>Assign Ticket</h2>
          <label>
            Select Ticket:
            <select
              value={selectedTicketAssign}
              onChange={e => setSelectedTicketAssign(e.target.value)}
            >
              <option value="">--Select Ticket--</option>
              {openTickets.map(ticket => (
                <option key={ticket.id} value={ticket.id}>
                  {ticket.title}
                </option>
              ))}
            </select>
          </label>

          <label>
            Select Agent:
            <select
              value={selectedAgent}
              onChange={e => setSelectedAgent(e.target.value)}
            >
              <option value="">--Select Agent--</option>
              {availableAgents.map(agent => (
                <option key={agent.id} value={agent.id}>
                  {agent.email}
                </option>
              ))}
            </select>
          </label>

          <button onClick={assignTicket}>Assign</button>
        </div>
      )}

      {activeView === 'viewProfile' && (
        <div>
          <h2>Profile</h2>
          <p>Name: {profile.name}</p>
          <p>Email: {profile.email}</p>
          <p>Role: {profile.role}</p>
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
